import React from "react";
import DeleteIcon from "@material-ui/icons/Delete";


function Note(props) {
  function handleClick() {
    props.onDelete(props.id);
  }

  return (
    //<div className="note" >
    <div className="note" 
      style={{
        backgroundColor: ((new Date())-((new Date(props.date)))>0 ? '#de4e33' : 
                         ((new Date())-((new Date(props.date)))>5 ? '#333' : '#fff')), 
      }}>
      <h5>{props.date}</h5>
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick={handleClick}>
        <DeleteIcon />
      </button>
    </div>
  );
}

<script src="https://momentjs.com/downloads/moment.js"></script>
export default Note;
